        •     Le test conditionnel:                 if                                                                                                                                                                                                                                                                                          

                               if (condition){                                                                                                                                                                                                                                                                                                  
                                    //  Exécute       ce  bloc    si   la condition        est   vraie                                                                                                                                                                                                                                          
                               }                                                                                                                                                                                                                                                                                                                

        •     Le test conditionnel:                 if (condition) { … } else { … }                                                                                                                                                                                                                                                             

                               If (condition)        {                                                                                                                                                                                                                                                                                          
                                    //  Exécute       ce  bloc    si   la condition        est   vraie                                                                                                                                                                                                                                          
                               } else {                                                                                                                                                                                                                                                                                                         
                                    //  Exécute       ce  bloc    si   la condition        est   fausse                                                                                                                                                                                                                                         
                               }                                                                                                                                                                                                                                                                                                                

